import React, { useState, useEffect } from 'react'


const Hourly = ({ hour, fToC }) => {
  const [time, setTime] = useState(new Date(hour.time * 1000));
  const [compHour, setCompHour] = useState(time.getHours());

  return (
    <div className="hour">
      <h6>{compHour}</h6>
      <img className="hour-img" src={window.location.origin + '/imgs/cloud-test.png'} />
      <h6>{fToC(hour.temperature)}</h6>
    </div>
  )
}

export default Hourly
